B.Pk=A.a(s(["1. Totalmente limitado: N\xe3o reage (n\xe3o geme, n\xe3o se segura a nada, n\xe3o se esquiva) a est\xedmulo doloroso, devido ao n\xedvel de consci\xeancia diminu\xeddo ou devido \xe0 seda\xe7\xe3o ou capacidade limitada de sentir dor na maior parte do corpo.","2. Muito limitado: Somente reage a est\xedmulo doloroso. N\xe3o \xe9 capaz de comunicar desconforto exceto atrav\xe9s de gemido ou agita\xe7\xe3o. Ou possui alguma defici\xeancia sensorial que limita a capacidade de sentir dor ou desconforto em mais de metade do corpo.","3. Levemente limitado: Responde a comando verbal, mas nem sempre \xe9 capaz de comunicar o desconforto ou expressar necessidade de ser mudado de posi\xe7\xe3o ou tem um certo grau de defici\xeancia sensorial que limita a capacidade de sentir dor ou desconforto em 1 ou 2 extremidades.","4. Nenhuma limita\xe7\xe3o: Responde a comandos verbais. N\xe3o tem d\xe9ficit sensorial que limitaria a capacidade de sentir ou verbalizar dor ou desconforto."]),t.s)
