B.Ut=new A.N(B.dj,["Mobilidade",u.x,B.KG],t.yf)
B.LO=A.a(s(["1. Muito pobre: Nunca come uma refei\xe7\xe3o completa. Raramente come mais de 1/3 do alimento oferecido. Come 2 por\xe7\xf5es ou menos de prote\xedna (carnes ou latic\xednios) por dia. Ingere pouco l\xedquido. N\xe3o aceita suplemento alimentar l\xedquido. Ou \xe9 mantido em jejum e/ou mantido com dieta l\xedquida ou IVs por mais de cinco dias.","2. Provavelmente inadequado: Raramente come uma refei\xe7\xe3o completa. Geralmente come cerca de metade do alimento oferecido. Ingest\xe3o de prote\xedna inclui somente 3 por\xe7\xf5es de carne ou latic\xednios por dia. Ocasionalmente aceitar\xe1 um suplemento alimentar ou recebe abaixo da quantidade satisfat\xf3ria de dieta l\xedquida ou alimenta\xe7\xe3o por sonda.","3. Adequado: Come mais da metade da maioria das refei\xe7\xf5es. Come um total de 4 por\xe7\xf5es de alimento rico em prote\xedna (carne e latic\xednios) todo dia. Ocasionalmente recusar\xe1 uma refei\xe7\xe3o, mas geralmente aceitar\xe1 um complemento oferecido. Ou \xe9 alimentado por sonda ou regime de nutri\xe7\xe3o parenteral total, o qual provavelmente satisfaz a maior parte das necessidades nutricionais.","4. Excelente: Come a maior parte de cada refei\xe7\xe3o. Nunca recusa uma refei\xe7\xe3o. Geralmente ingere um total de 4 ou mais por\xe7\xf5es de carne e latic\xednios. Ocasionalmente come entre as refei\xe7\xf5es. N\xe3o requer suplemento alimentar."]),t.s)
B.Uq=new A.N(B.dj,["Nutri\xe7\xe3o","Padr\xe3o usual de consumo alimentar.",B.LO],t.yf)
B.M0=A.a(s(["1. Problema: Requer assist\xeancia moderada a m\xe1xima para se mover. \xc9 imposs\xedvel levant\xe1-lo ou ergu\xea-lo completamente sem que haja atrito da pele com o len\xe7ol. Frequentemente escorrega na cama ou cadeira, necessitando frequentes ajustes de posi\xe7\xe3o com o m\xe1ximo de assist\xeancia. Espasticidade, contratura ou agita\xe7\xe3o leva a quase constante fric\xe7\xe3o.","2. Problema em potencial: Move-se mas, sem vigor ou requer m\xednima assist\xeancia. Durante o movimento provavelmente ocorre um certo atrito da pele com o len\xe7ol, cadeira ou outros. Na maior parte do tempo mant\xe9m posi\xe7\xe3o relativamente boa na cama ou na cadeira mas ocasionalmente escorrega.","3. Nenhum problema: Move-se sozinho na cama ou cadeira e tem suficiente for\xe7a muscular para erguer-se completamente durante o movimento. Sempre mant\xe9m boa posi\xe7\xe3o na cama ou cadeira."]),t.s)
